@if(
  less(
    pipeline().parameters.RerunFromDate
  , formatDateTime(replace(activity('GET TGT HighWaterMark').output.runOutput,' ','T'), 'yyyy-MM-dd HH:mm:ss.fff')
  )
  , pipeline().parameters.RerunFromDate
  , formatDateTime(replace(activity('GET TGT HighWaterMark').output.runOutput,' ','T'), 'yyyy-MM-dd HH:mm:ss.fff')
)

query.value:
SELECT MAX(LastModifiedDate) AS HighWaterMark
FROM  @{pipeline().parameters.sfschemaname}.@{pipeline().parameters.sfTableName}
WHERE LastModifiedDate >= {ts'@{variables('brpExtractFrom')}'}

value.value:
@if(
    less(pipeline().parameters.RerunToDate, formatDateTime(activity('GET SRC HighWaterMark').output.firstRow.HighWaterMark, 'yyyy-MM-dd HH:mm:ss.fff')),
    pipeline().parameters.RerunToDate,
    addDays(formatDateTime(activity('GET SRC HighWaterMark').output.firstRow.HighWaterMark, 'yyyy-MM-dd HH:mm:ss.fff'), -600)
)

query.value:
