FROM @{pipeline().parameters.sfTableName}
WHERE LastModifiedDate > TIMESTAMP '@{formatDateTime(variables('brpExtractFrom'), 'yyyy-MM-dd HH:mm:ss')}'
  AND CreatedDate <= TIMESTAMP '@{formatDateTime(variables('brpExtractTo'), 'yyyy-MM-dd HH:mm:ss')}'
